import './App.css';
import Navbar from './Components/Navbar';
import Sidebar from './Components/Sidebar';
import AddTask from './Components/AddTask';

function App() {
  return (
    <body>
      <Navbar name="To Do"></Navbar>
      <Sidebar/>
      <AddTask></AddTask>
    </body>
  );
}

export default App;
